$bleu: #09021e;
$cyan: #4cc9f0;
$magenta: #f72585;
* {
    box-sizing: border-box;
    cursor: none!important;
}

body {
    margin: 0;
    padding: 0;
    width: 100%;
    background: $bleu;
    overflow: hidden;
}

canvas {
    display: block;
    position: absolute;
    z-index: -1;
    &.hologramActive {
        transition: mix-blend-mode 2s cubic-bezier(.25, 0, 0, 1);
        // mix-blend-mode: difference;
        // opacity: 0.5;
        animation: blinkCanvas 6s infinite;
    }
    &.hologramDefault {
        transition: mix-blend-mode 2s cubic-bezier(.25, 0, 0, 1);
        mix-blend-mode: normal;
        // opacity: 1;
        animation: none;
    }
    @keyframes blinkCanvas {
        30% {
            opacity: 1;
        }
        32% {
            opacity: .7;
        }
        33% {
            opacity: 1;
        }
        35% {
            opacity: .7;
        }
        40% {
            opacity: 1;
        }
        80% {
            opacity: .7;
        }
        82% {
            opacity: 1;
        }
        85% {
            opacity: .8;
        }
        87% {
            opacity: 1;
        }
    }
}

